import React from 'react';
import useAudioPlayer from "./useAudioPlayer";
import PlayButton from "./PlayButton";

const MusicPlayer = () => {
  const { play, progress } = useAudioPlayer();
  return (
    <>
      <PlayButton />
      <progress value={progress} max={100} />
    </>
  );
};

export default MusicPlayer;
